import React, { Component } from "react";
import axios from 'axios';
import { ReactDOM } from "react";

export default class Location extends Component {
    constructor() {
        super();

        this.state = {
            icao_code: ''
         };
        }

        handleLocationSubmission = e => {
            e.preventDefault();
            const icao_code = this.state;
            const options = {
                url: `http:localhost:4000/metar?icao=${icao_code}`,
                method: "GET"
            }
            axios(options)
            .then(function (response) {
                console.log(`Sent user Metar data of ${icao_code}`)
            })
            .catch(function (err) { console.log(err); })
        };
        render() {
            return(
                <div>
                    <form onSubmit={this.handleLocationSubmission}>
                        <label for="location">Enter ICAO Code</label>
                        <input type="text" name="location"></input>
                    </form>
                </div>
            );
        }
    }
